import { Component } from 'react'
import Banner from '../../components/Banner'
import { dataAppart } from '../../data/dataAppart'

class Home extends Component {
  render() {
    return (
      <div className="container">
        <Banner />
        <main>
          {dataAppart.map((el) => {
            return <h2>{el.title}</h2>
          })}
        </main>
      </div>
    )
  }
}

export default Home
